import React from "react";
import styled from 'styled-components';
import AppHeader from "../../components/AppHeader";

const CategoryBox = styled.div`
    border: 1px solid gray;
    display: flex;
    position: relative; /* Add relative positioning to the parent container */

    button {
        /* Styles for the button element */
        background-color: #007bff;
        color: white;
        /* Add any other styles you want for the button */
    }

    /* Define a pseudo-element for additional styling */
    button::after {
        content: "ㅣ"; /* Add content to create a pseudo-element */
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        /* Add any other styles you want for the pseudo-element */
    }
`;

const Employment = () => {
    return (
        <>
            <AppHeader />
            <CategoryBox>
                <button>전체</button>
                <div>직군을 선택해주세요.</div>
            </CategoryBox>
        </>
    );
}

export default Employment;
